import GamePanel from "./components/game-panel/game-panel.component";
import Card from "./components/card/card.component";

function App() {
  return (
      <div id="container">
          <Header />
          <main>
              <ControlPanel />
              {  <GamePanel /> }
              <Card name = "js"/>
          </main>
          <Footer />
      </div>
  );
}

export default App;
